import React from "react";
import './style.css';

function Landing() {
    return(
        <div className="landing">
            <h1><b>Hello, I'm Pat</b></h1>
            <h3>I'm a <b><i>Full Stack</i></b> Developer</h3>
            <div className="buttons">
                <a className="waves-effect waves-light blue darken-1 btn-large z-depth-0"><b>Resume</b></a>
                <a className="waves-effect waves-light blue darken-1 btn-large z-depth-0"><b>Projects</b></a>
                <a className="waves-effect waves-light blue darken-1 btn-large z-depth-0"><i class="fab fa-github-square"></i></a>
                <a class="waves-effect waves-light blue darken-1 btn-large z-depth-0"><i class="fab fa-linkedin"></i></a>
            </div>
        </div>
    )
}

export default Landing;
